import React, { Component } from "react";

const Like = (props) => {
  getLikeUnlike = () => {
    let classes = "fa fa-heart-o";
    classes = props.count % 2 === 0 ? "fa fa-heart-o" : "fa fa-heart";
    return classes;
  };
  return (
    <i onClick={props.onLike} className='fa fa-heart-o' aria-hidden='true'></i>
  );
};

export default Like;
